  summary: Represents a collection of <xref href="System.Web.Configuration.OutputCacheProfile"></xref> objects. This class cannot be inherited.
  remarks: "The <xref:System.Web.Configuration.OutputCacheProfileCollection> allows to centralize the management of the output cache settings used by pages or user controls.  \n  \n It allows you to programmatically access and modify the <xref:System.Web.Configuration.OutputCacheProfile> objects it contains.  \n  \n> [!NOTE]\n>  The <xref:System.Web.Configuration.OutputCacheProfile> can be applied to a page using the `CacheProfile` attribute of the [@ OutputCache](http://msdn.microsoft.com/en-us/28a9e101-fb44-4198-9cb6-b8a52312fec2) directive."
